import React from "react";

export default function Footer() {
    return (
        <footer>
            <address>Created by <a href="google.com" target="_blank">Lee Sze Foo</a></address>
            <p>Alarm sound by <a href="https://www.zedge.net/ringtone/231254e0-fce3-31a6-9a6a-0f8d5ec5d701">lawknight</a></p>
        </footer>
    )
}
